const LOGO_BASE64 = "data:image/png;base64,";

// ===== DATABASE RESEP =====
const resepDB = {
  "Nasi Goreng": { beras: 200, cabai: 20, minyak: 30 },
  "Sayur Asem": { beras: 100, cabai: 15, minyak: 10 },
  "Tumis Kangkung": { beras: 0, cabai: 10, minyak: 15 },
  "Ayam Goreng": { beras: 0, cabai: 10, minyak: 25 }
};

// ===== PROFIL =====
function simpanProfil() {
  const anggota = document.getElementById("anggota").value;
  const porsi = document.getElementById("porsi").value;

  const data = { anggota, porsi };
  localStorage.setItem("profil", JSON.stringify(data));
  alert("Profil disimpan!");
}

// ===== MEAL PLAN (DROPDOWN) =====
function tambahMenu() {
  const select = document.getElementById("menuSelect");
  const menu = select.value;
  if (!menu) return;

  let menus = JSON.parse(localStorage.getItem("menuList")) || [];
  menus.push(menu);
  localStorage.setItem("menuList", JSON.stringify(menus));

  tampilkanMenu();
}

function tampilkanMenu() {
  const ul = document.getElementById("menuList");
  ul.innerHTML = "";

  const menus = JSON.parse(localStorage.getItem("menuList")) || [];
  menus.forEach(menu => {
    const li = document.createElement("li");
    li.textContent = menu;
    ul.appendChild(li);
  });
}

// ===== PANTRY =====
function simpanPantry() {
  const pantry = {
    beras: Number(document.getElementById("beras").value) || 0,
    cabai: Number(document.getElementById("cabai").value) || 0,
    minyak: Number(document.getElementById("minyak").value) || 0
  };
  localStorage.setItem("pantry", JSON.stringify(pantry));
  alert("Stok dapur disimpan!");
}

// ===== SHOPPING LIST OTOMATIS =====
function hitungBelanja() {
  const list = document.getElementById("list");
  list.innerHTML = "";

  const menuText = localStorage.getItem("menu");
  if (!menuText) {
    list.innerHTML = "<li>Belum ada menu</li>";
    return;
  }

  const menus = menuText.split(",").map(m => m.trim());
  const pantry = JSON.parse(localStorage.getItem("pantry")) || {};

  let total = { beras: 0, cabai: 0, minyak: 0 };
  let shoppingArr = [];

  menus.forEach(menu => {
    if (resepDB[menu]) {
      const resep = resepDB[menu];
      Object.keys(resep).forEach(bahan => {
        total[bahan] += resep[bahan];
      });
    }
  });

  Object.keys(total).forEach(item => {
    const kurang = total[item] - (pantry[item] || 0);
    if (kurang > 0) {
      const text = `${item} : beli ${kurang} gram/ml`;
      const li = document.createElement("li");
      li.textContent = text;
      list.appendChild(li);
      shoppingArr.push(text);
    }
  });

  if (shoppingArr.length === 0) {
    const li = document.createElement("li");
    li.textContent = "Semua stok aman ";
    list.appendChild(li);
    shoppingArr.push("Semua stok aman ");
  }

  //  SIMPAN UNTUK PDF
  localStorage.setItem("shoppingList", JSON.stringify(shoppingArr));
}


function tampilkanShoppingList() {
  const list = document.getElementById("list");
  list.innerHTML = "";

  const data = JSON.parse(localStorage.getItem("shoppingList")) || [];

  data.forEach(item => {
    const li = document.createElement("li");
    li.textContent = item;
    list.appendChild(li);
  });
}


// ===== ECO REPORT =====
let ecoChartInstance = null;

function hitungEco() {
  const profil = JSON.parse(localStorage.getItem("profil")) || { anggota: 1 };
  const anggota = Number(profil.anggota || 1);

  // Asumsi rata-rata
  const sampahPerOrang = 0.3; // kg/minggu
  const penghematanUangPerOrang = 15000; // rupiah/minggu

  const totalSampah = (sampahPerOrang * anggota).toFixed(2);
  const totalUang = penghematanUangPerOrang * anggota;

  document.getElementById("hematSampah").innerText =
    `Sampah Dihindari:  ${totalSampah} kg / minggu`;

  document.getElementById("hematUang").innerText =
    `Hemat Uang:  Rp ${totalUang.toLocaleString("id-ID")} / minggu`;

  const ctx = document.getElementById("ecoChart").getContext("2d");

  if (ecoChartInstance) {
    ecoChartInstance.destroy();
  }

  ecoChartInstance = new Chart(ctx, {
    type: "bar",
    data: {
      labels: ["Sampah (kg/minggu)", "Hemat Uang (ribu Rp/minggu)"],
      datasets: [{
        label: "Dampak KAK LUNA",
        data: [totalSampah, totalUang / 1000],
        backgroundColor: ["#4caf50", "#ff9800"]
      }]
    },
    options: {
      responsive: true,
      plugins: {
        legend: { display: false }
      },
      scales: {
        y: {
          beginAtZero: true
        }
      }
    }
  });
}



// Tampilkan otomatis saat halaman dibuka
document.addEventListener("DOMContentLoaded", () => {
  tampilkanMenu();
  tampilkanShoppingList();
});

function resetMenu() {
  if (!confirm("Yakin mau ganti seluruh rencana menu minggu ini?")) return;

  localStorage.removeItem("menuList");
  localStorage.removeItem("shoppingList");

  tampilkanMenu();
  tampilkanShoppingList();
}

function resetPantry() {
  if (!confirm("Yakin mau reset semua stok dapur?")) return;

  localStorage.removeItem("pantry");
  localStorage.removeItem("shoppingList");
  tampilkanShoppingList();

  document.getElementById("beras").value = "";
  document.getElementById("cabai").value = "";
  document.getElementById("minyak").value = "";

  alert("Stok dapur sudah direset.");
}

function exportPDF() {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  const data = JSON.parse(localStorage.getItem("shoppingList")) || [];

  if (data.length === 0) {
    alert("Shopping list masih kosong ");
    return;
  }

  // Logo
  doc.addImage(LOGO_BASE64, "PNG", 14, 10, 25, 25);

  // Judul
  doc.setFontSize(18);
  doc.text("KAK LUNA", 45, 20);
  doc.setFontSize(12);
  doc.text("Shopping List  Belanja Dapur Terencana", 45, 28);

  // Garis
  doc.line(14, 35, 196, 35);

  // Tanggal
  doc.setFontSize(10);
  doc.text("Tanggal: " + new Date().toLocaleDateString("id-ID"), 14, 42);

  let y = 52;
  doc.setFontSize(11);

  data.forEach((item, index) => {
    doc.text(`${index + 1}. ${item}`, 14, y);
    y += 8;
  });

  // Footer
  doc.setFontSize(9);
  doc.text("Generated by KAK LUNA Web App", 14, 285);

  doc.save("KAK_LUNA_Shopping_List.pdf");
}

